                content:
                  ".small-size {\n  height: 0;\n}\n\n.g-table {\n  display: flex;\n  flex-flow: row wrap;\n}\n\n.g-sample-image {\n  max-width: 300px;\n  max-height: 300px;\n}\n\n.highly-styled-toolbar {\n  width: 100vw;\n  height: 70px;\n  background-color: rgba(37, 53, 59, 0.384);\n  display: flex;\n  flex-flow: row nowrap;\n  justify-content: center;\n  align-items: center;\n  box-shadow: 0 0 15px 15px rgba(54, 78, 87, 0.11);\n}\n\n.highly-styled-button {\n  border: 0;\n  vertical-align: baseline;\n  border-radius: 7px;\n  color: #4dee3e;\n  text-align: center;\n  width: 70px;\n  height: 40px;\n  line-height: 40px;\n  font-family: 'Lato', 'Lucida Grande', 'Lucida Sans Unicode', Tahoma, Sans-Serif;\n  font-size: 20px;\n  font-weight: 500;\n  background: #505152;\n\n  margin-right: 3em;\n  &:hover {\n    cursor: pointer;\n    color: #eee;\n  }\n}\n",
