                  "[class*='g-arrow'] {\n  display: block;\n  width: 35px;\n  height: 35px;\n  position: relative;\n  transform: rotate(-45deg);\n  background-color: rgb(88, 88, 88);\n  transition: all 0.18s;\n  &::after {\n    position: absolute;\n    content: '';\n    top: -1px;\n    left: -1px;\n    width: 28px;\n    height: 28px;\n    background-color: #fff;\n  }\n}\n\n.g-arrow-left {\n  transform: rotate(135deg);\n}\n\n.g-slide-gallery-wrapper {\n  display: flex;\n  flex-direction: column;\n  overflow: hidden;\n  // background: #f5f5f5;\n\n  & > .g-gallery-current {\n    flex: 1 1;\n    overflow: hidden;\n    display: flex;\n    flex-direction: column;\n\n    .g-gallery-current-title {\n      position: absolute;\n      line-height: 76px;\n      height: 76px;\n      font-size: 20px;\n      color: #535353;\n      padding: 0 93px;\n      background: rgba(99, 99, 99, 0.087);\n      width: 100%;\n\n      & > span {\n        font-size: 14px;\n      }\n    }\n\n    .g-gallery-current-content {\n      flex: 1 1;\n      display: flex;\n      padding: 76px 15px 27px;\n      justify-content: space-between;\n      align-items: center;\n      position: relative;\n      overflow: hidden;\n      .g-gallery-image {\n        position: relative;\n        flex: 1;\n        & > img {\n          left: 50%;\n          top: 50%;\n          width: 100%;\n          transform: translate(-50%, -50%) scale(1);\n          position: absolute;\n          cursor: all-scroll;\n        }\n      }\n    }\n  }\n\n  & > .g-gallery-slider {\n    display: flex;\n    flex: 0 0 210px;\n    flex-flow: row nowrap;\n    width: 100%;\n    box-shadow: 0px -2px 3px 1px #cacaca;\n\n    & > .g-gallery-slider-content {\n      width: 100%;\n      display: flex;\n      flex-flow: row nowrap;\n      align-items: center;\n      overflow: hidden;\n      overflow-x: auto;\n      margin: 0 40px 0;\n\n      img {\n        width: 145px;\n        height: 109px;\n        margin-right: 24px;\n        cursor: pointer;\n        &:last-child {\n          margin-right: 0;\n        }\n      }\n    }\n  }\n}\n\n.g-gallery-placeholder {\n  display: flex;\n  flex-direction: column;\n  align-items: center;\n  justify-content: center;\n  height: 100%;\n  flex: 1;\n}\n\n.g-gallery-slider-item.selected {\n  border: #ff6666 2px solid;\n}\n\n.g-gallery-slider-action {\n  cursor: pointer;\n  user-select: none;\n  &:hover {\n    background-color: #ff6666;\n  }\n}\n",
