            sources: {
              _: {
                tsx:
                  "import { Button } from 'antd';\nimport React, { useState } from 'react';\nimport { VideoInput } from '../core/VideoInput';\nimport './demo.less';\n\nconst LiveSteamDemo = () => {\n  const [onStreaming, setOnStreaming] = useState(false);\n  const [onSelfie, setOnSelfie] = useState(true);\n  const handleStreamClick = () => {\n    setOnStreaming(s => !s);\n  };\n\n  const handleSelfieClick = () => {\n    setOnSelfie(s => !s);\n  };\n\n  return (\n    <div className=\"demo-live-stream-wrapper\">\n      \u4f7f\u7528\u7cfb\u7edf\u6444\u50cf\u5934\n      <br />\n      <br />\n      <Button onClick={handleStreamClick}>\u6253\u5f00/\u5173\u95ed\u76f4\u64ad</Button>\n      <br />\n      <br />\n      <Button onClick={handleSelfieClick}>\u6253\u5f00/\u5173\u95ed\u81ea\u62cd\u753b\u9762</Button>\n      <br />\n      <br />\n      <VideoInput onStreaming={onStreaming} onSelfie={onSelfie} audio={false} />\n    </div>\n  );\n};\n\nexport default () => <LiveSteamDemo />;\n",
              },
              'core/VideoInput.tsx': {
                import: '../core/VideoInput',
                content:
                  "import React, { useEffect, useRef, useState } from 'react';\nimport { RecordControls } from '../components/RecordControls';\nimport { getUserMedia } from '../methods';\nimport { MediaInputProps } from '../typings/interfaces';\n\nexport interface VideoInputProps extends MediaInputProps {\n  audio?: boolean; // audio input is optional\n  onSelfie?: boolean; // return a video element showing selfie\n  getMediaStream?: (stream: MediaStream | null) => any;\n}\n\nexport const VideoInput = (props: VideoInputProps) => {\n  const { audio = true, onSelfie = false, recordControls = true, getMediaStream, onStreaming } = props;\n\n  const [stream, setStream] = useState<MediaStream | null>(null);\n\n  const videoEle = useRef<HTMLVideoElement>(null);\n\n  /* load stream */\n  useEffect(() => {\n    onStreaming ? getUserMedia({ audio }).then(s => setStream(s)) : setStream(null);\n  }, [getUserMedia, onStreaming]);\n\n  /* on selfie,reflect to ref => video  */\n  useEffect(() => {\n    if (!videoEle.current) {\n      return;\n    }\n    videoEle.current.srcObject = stream;\n  }, [stream, videoEle.current]);\n\n  /* need transport stream? */\n  useEffect(() => {\n    if (!getMediaStream) {\n      return;\n    }\n    onStreaming ? getUserMedia({ audio }).then(s => getMediaStream(s)) : getMediaStream(null);\n  }, [onStreaming, getMediaStream]);\n\n  const renderSelfieVideo = () => <video ref={videoEle} controls={true} autoPlay={true}></video>;\n\n  return (\n    <>\n      {onSelfie && renderSelfieVideo()}\n      {recordControls && <RecordControls stream={stream} />}\n    </>\n  );\n};\n",
              },
              'components/RecordControls.tsx': {
                import: '../components/RecordControls',
                content:
                  "import React, { useEffect, useState } from 'react';\nimport { RecorderControlsProps } from '../typings/interfaces';\n\nconst defaultMIMEType = 'video/webm;codecs=h264';\n\nexport const RecordControls: React.FC<RecorderControlsProps> = ({ stream = null }) => {\n  const [recorder, setRecorder] = useState<Recorder>();\n  const [paused, setPaused] = useState<boolean>(false);\n  const [data, setData] = useState<Blob>();\n\n  /* check browser able to record */\n  async function recorderGenerator(): Promise<void> {\n    let result = MediaRecorder.isTypeSupported(defaultMIMEType);\n\n    if (!result) {\n      throw new Error(`Media MIME type: ${defaultMIMEType}, is not supported! `);\n    }\n\n    try {\n      let recorder = await new MediaRecorder(stream);\n      recorder.ondataavailable = finishRecording;\n      setRecorder(recorder);\n    } catch (e) {\n      console.error(`failed to generate recorder, stream: %s error: %o`, stream, e);\n    }\n  }\n\n  /* start checking when stream is loaded */\n  useEffect(() => {\n    if (stream) {\n      recorderGenerator()\n        .then(() => console.log('loaded'))\n        .catch(() => console.log('failed'));\n    }\n  }, [stream]);\n\n  /* when recorded */\n  const finishRecording = (e: { data: Blob }): void => {\n    console.log(e);\n    setData(e.data);\n  };\n\n  /* handle recording */\n  const startRecording = () => {\n    recorder && recorder.start();\n    console.log('%cSTARTED', 'color: #0fe');\n  };\n\n  const stopRecording = () => {\n    recorder && recorder.stop();\n    console.log('%cSTOPPED', 'color: red');\n  };\n\n  const pauseRecording = () => {\n    recorder && recorder.pause();\n    setPaused(true);\n  };\n\n  const resumeRecording = () => {\n    recorder && recorder.resume();\n    setPaused(false);\n  };\n\n  const requestRecordedData = () => {\n    recorder && console.log(recorder.requestData());\n  };\n\n  return (\n    <div>\n      <button onClick={startRecording}> start</button>\n      <button onClick={stopRecording}> stop</button>\n      <button onClick={paused ? resumeRecording : pauseRecording}> pause/resume</button>\n    </div>\n  );\n};\n",
              },
              'methods.ts': {
                import: '../methods',
                content:
                  "interface MediaInputProps {\n  video?: boolean;\n  audio?: boolean;\n}\n\ntype AudioDevice = 'audioinput' | 'audiooutput';\ntype VideoDevice = 'videoinput' | 'videooutput';\n\nexport async function loadSystemDevices() {\n  let devices = await navigator.mediaDevices.enumerateDevices();\n  return devices;\n}\n\nexport function getDevices(devices: MediaDeviceInfo[], type: AudioDevice | VideoDevice): MediaDeviceInfo[] {\n  let audioDevices = devices.filter(item => item.kind === type);\n  return audioDevices;\n}\n\nexport async function getUserMedia(props?: MediaInputProps) {\n  let constraints = { video: true, audio: true, ...props };\n  let stream = await navigator.mediaDevices.getUserMedia(constraints);\n  return stream;\n}\n\n// deprecate\nexport async function closeUserMedia() {\n  let stream = await navigator.mediaDevices.getUserMedia({ video: false, audio: false });\n  return stream;\n}\n",
              },
              'demo.less': { import: './demo.less', content: '' },
            },
