                  "import { useEffect, useMemo, useState } from 'react';\n\ninterface BaseInfo {\n  id: number | null;\n  name: string | null;\n}\n\nexport interface Company extends BaseInfo {}\nexport interface Position extends BaseInfo {}\nexport interface User extends BaseInfo {\n  age: number | null;\n}\n\ninterface StoreProps {\n  user: User | null;\n  company: null | Company;\n  position: Position | null;\n}\n\nconst defaultStore = {\n  user: null,\n  company: null,\n  position: null,\n};\n\n/**\n * useStore\n * \u76ee\u7684\xb7\u4f7f\u7528contextApi\u548cuseState\u5171\u4eab\u5355\u9879\u72b6\u6001\n */\nexport function useDemoStore() {\n  const [store, setStore] = useState<StoreProps>(defaultStore);\n\n  const setter = useMemo(\n    () => ({\n      setUser(user: User) {\n        setStore(s => {\n          const updateState = { ...s };\n          updateState.user = user;\n          return updateState;\n        });\n      },\n\n      setCompany(newCompany: Company | null) {\n        setStore(s => {\n          const updateState = { ...s };\n          updateState.company = newCompany;\n          return updateState;\n        });\n      },\n\n      setPosition(position: Position | null) {\n        setStore(s => {\n          const updateState = { ...s };\n          updateState.position = position;\n          return updateState;\n        });\n      },\n    }),\n    [],\n  );\n\n  useEffect(() => {\n    if (store.company) {\n      // fetch new position\n    } else {\n      setter.setPosition(null);\n    }\n  }, [store.company]);\n\n  return [store, setter] as const;\n}\n\nexport default useDemoStore;\n",
